(1, 'National Conference on Beneficial Microbes & Sustainable Crop Production, February 19-20, 2020', '15/01/20', '                                  \r\n      The Department of Agronomy, Faculty of Crop Production Sciences, The University of Agriculture Peshawar in collaboration with American Society of Microbiologists (ASM) has planned a two-day national conference on: Beneficial Microbes & Sustainable Crop Production to be held on February 19-20, 2020. It is a useful event for faculty especially young faculty and senior students (MSc, MPhil and PhD), Agriculture Extension Officers & Researchers to present their research work at this high-level forum at the beautiful campus of The University of Agriculture Peshawar.                          '),
